import React, {Component} from 'react';
import { Link } from 'react-router-dom';

import '../style/header.css';

class Hi extends Component {
    state = {
        number : []
    }

    render() {
        return (
            <div className="header">
                <h1> {this.state.number} </h1>

            </div>
        );
    }
}

export default Hi;
